text:
@PookyH 1. Replanting all my seedlings and noticing I’ve got cucumbers already 
2. I actually went out out and had lunch with the teen in cafe 
3. Had the car washed and cleaned by the very efficient lads down at the station. https://t.co/0inQoocTnv

@SENDMattersUK They have to acknowledge your child has SEND first and reply to emails from ASC specialist centres before... oh look your kids left school now, not
problem. 
Sorry. I’m angry.

@MrGPrimary Previous school - 3 days a week = 4 1/2 days working.
New school -4 days a week = 4 and a bit days working if I’ve slacked a bit during the week (not including this exams debacle which isn’t their fault) 
It’s a toxic school thing.

@SemhOutreach I caught a very anxious child doodling in their book last week. I went over with a piece of paper. 
What’s that? They said. Paper to draw on I said. Don’t doodle in your book.
 I can doodle? They said. Of course, as long as you listen as well.

@Mr_B_Morgan @BraaiKing_Bad I have done absolutely nothing work wise the last 10 days and I actually feel rested for the first time for quite some time.
Next term is going to be mental what with TAG and assessments etc.
A restful holiday is needed and deserved.

@BenRichards934 @MrTs_NQTs @TeachStMarys Congratulations.
Toss a coin. Heads is one school, tails
Is the other. You’ll know as you’ll be disappointed or not. Always works 😀

@Claire_R123 @gdmorewood @ReachoutASC I never have any idea what going on in a film unless is really obvious. It drives my husband mad. I too watch action films as there’s not a great deal to understand.  And jurassic park,
I love Jurassic park.
And ET.
